export const cartReducer = (state={}, action) => {
  switch (action.type) {
    case "ADD_IITEM":
      return {
        ...state,
        item: action.type
      }
      case "DELETE_ITEM":
        // return [...state, action.payload]
        return {
          ...state,
          item: action.type
        }
    default:
      return state
  }
}
